INSERT INTO `announcements` VALUES (5,'Important Notice: Facilities Update and Parking Reminder','<p><strong>Dear Team,</strong></p>\r\n\r\n<p>I wanted to inform you about a couple of updates regarding our office facilities:</p>\r\n\r\n<p><strong>Toilet Facilities:</strong> The management toilet near the server room is designated for management personnel. For employees, please use the facilities located in the MINE section.</p>\r\n\r\n<p><strong>Parking Reminder</strong>: When parking in the parking area, please ensure that you use center stands. Using side stands takes up more space and can inconvenience others.</p>\r\n\r\n<p><strong>Workspace Organization</strong>: Please refrain from placing personal bags on top of work tables. Kindly utilize the drawers provided for keeping your belongings.</p>\r\n\r\n<p><strong>Office Cleanliness</strong>: To maintain a clean and tidy office space, please avoid leaving wrappers and papers on your desk. Use the dustbins provided for disposing of waste.</p>\r\n\r\n<p>Thank you for your attention to these matters. If you have any questions or need further clarification, please don&rsquo;t hesitate to reach out.</p>\r\n\r\n<p><strong>Best regards,</strong></p>\r\n','2024-06-21 08:49:54','1'),(10,'Due to Internet Issue Mr Ramkumar  & Mr Daniel Announced & Mr Karthikeyan  Day off','<p>Hai Team,<br />\r\n<br />\r\nDue to Internet issue here no one can be able to work so that&nbsp;Mr Ramkumar &nbsp;&amp; Mr Daniel Announced &amp; Mr Karthikeyan Announced Day off&nbsp;<br />\r\n<br />\r\nThank you<br />\r\n<br />\r\nBest Regards,<br />\r\n&nbsp;</p>\r\n','2024-07-06 09:30:27','1');
