INSERT INTO `tblleaves` VALUES (12,'5','2024-06-10','2024-06-10','<p>Sick leave</p>\r\n','2024-06-10 09:25:36',NULL,NULL,1,NULL,36,'1','0','1',0,NULL,NULL),(24,'2','2024-06-19','2024-06-19','<p>Subject: Request for One Day Leave Due to Hospital Visit</p>\r\n\r\n<p>Dear sir,</p>\r\n\r\n<p>I hope this message finds you well. I am writing to request a one-day leave on 19/06/2024&nbsp;as I need to visit the hospital to attend to a pressing health issue concerning a close relative.</p>\r\n\r\n<p>The nature of this visit requires my presence and I anticipate being away for the entire day. I have ensured that my current tasks are up to date, and I will make arrangements to complete any pending work before my leave. Additionally, I will be available via phone or email in case of any urgent matters that require my attention.I apologize for any inconvenience this may cause and appreciate your understanding and support. Please let me know if you need any further information or if there are any additional steps I need to take to formalize this request.</p>\r\n\r\n<p>Thank you for your consideration.</p>\r\n\r\n<p>Best regards,<br />\r\nBHANU PRASAD YADAV P<br />\r\nJr java developer<br />\r\n9632920686</p>\r\n','2024-06-18 16:00:06',NULL,NULL,1,NULL,30,'1','0','1',0,NULL,NULL),(26,'2','2024-06-21','2024-06-21','<p>Due to some emergency&nbsp;</p>\r\n','2024-06-21 01:47:55',NULL,NULL,1,NULL,13,'1','0','1',0,NULL,NULL),(27,'2','2024-06-21','2024-06-21','<p>I have a fever today, hence I was unable to attend office.&nbsp;<br />\r\n<br />\r\nI will continue from tomorrow.&nbsp;</p>\r\n','2024-06-21 05:38:00',NULL,NULL,1,NULL,61,'1','0','1',0,NULL,NULL),(28,'2','2024-06-25','2024-06-25','<p>Subject: Request for One Day Personal Leave</p>\r\n\r\n<p>Dear Sir/Mam,</p>\r\n\r\n<p>I hope this message finds you well. I am writing to inform you that I need to take a personal leave on 25 june 2024.I will be unable to attend work on that day.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Thanks and regards<br />\r\nSharathchandra BR<br />\r\nFront-end Developer</p>\r\n','2024-06-22 05:19:42',NULL,NULL,1,NULL,38,'1','0','1',0,NULL,NULL),(30,'2','2024-06-24','2024-06-24','<p>Subject: Request for One Day Leave</p>\r\n\r\n<p>Hi sir,</p>\r\n\r\n<p>I need to address an urgent issue with my bank account and will need to take a day off tomorrow to visit the bank.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Best,</p>\r\n\r\n<p>Bhanuprasadyadav P</p>\r\n\r\n<p>Jr Java developer&nbsp;</p>\r\n','2024-06-23 15:02:39',NULL,NULL,1,NULL,30,'1','0','1',0,NULL,NULL),(31,'2','2024-06-24','2024-06-24','<p>Good morning Meena,</p>\r\n\r\n<p>I need to take a leave today as my spectacles fell down &amp;they&nbsp; broken as I&#39;m in&nbsp; my way to the office, and I am unable to work without them. I apologize for any inconvenience caused.</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>Purnima M.S</p>\r\n','2024-06-24 04:55:01',NULL,NULL,1,NULL,48,'1','0','1',0,NULL,NULL),(32,'2','2024-06-25','2024-06-24','<p>Requesting for leave&nbsp;</p>\r\n\r\n<p>As above subject I met with an minor accident so,I request you to grant a leave from today afternoon 24/Jun to tomorrow afternoon 25/Jun and I have 2 casual now I&#39;m spending one for this reason,hope you understand the condition.</p>\r\n\r\n<p>Thank you&nbsp;</p>\r\n','2024-06-24 09:02:48',NULL,NULL,1,'1',24,'1','0','2',0,NULL,NULL),(33,'2','2024-06-25','2024-06-25','<p>Medical Treatment, Rejection of permission to work from home&nbsp;</p>\r\n','2024-06-24 13:35:37',NULL,NULL,1,NULL,36,'1','0','1',0,NULL,NULL),(34,'2','2024-06-25','2024-06-25','<p>I hope this message finds you well. I m feeling unwell today due to fever and cold. Consequently, I will be unable to perform my duties effectively. I&#39;ll keep you updated on my progress and ensure a smooth transition of my tasks during my absence.</p>\r\n\r\n<p>Therefore, I kindly request a one day leave.I appreciate your understanding and support in this matter.</p>\r\n\r\n<p>Appreciate your understanding.</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>Nithyashree N Bannur</p>\r\n\r\n<p>Jr Java developer.</p>\r\n\r\n<p>&nbsp;</p>\r\n','2024-06-25 03:31:08',NULL,NULL,1,NULL,31,'1','0','1',0,NULL,NULL),(35,'2','2024-06-25','2024-06-25','<p>I hope this mail finds you well. I am writing to formally request a leave of absence on 25/06/2024. The reason for my leave is , Health issue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I would be grateful if you can approve my leave request for the mentioned day.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hoping to receive a positive response from you.</p>\r\n','2024-06-25 04:16:58',NULL,NULL,1,NULL,21,'1','0','1',0,NULL,NULL),(36,'2','2024-06-28','2024-06-27','<p>Dear Sir/Ma&#39;am,</p>\r\n\r\n<p>Im going home&nbsp;after long time for a medical check up and I&#39;m requesting you to grant me leave for 27th and 28th of June 2024. I assure you that I&#39;ll complete all my task before going home&nbsp; and assigned work to my team members as well and make sure my absent will not affect the ongoing project. I&nbsp;will be available through phone in case of any emergency.</p>\r\n\r\n<p>Thanks &amp; Regards,</p>\r\n\r\n<p>Meena M</p>\r\n\r\n<p>&nbsp;</p>\r\n','2024-06-25 09:07:48',NULL,NULL,1,NULL,33,'1','0','2',0,NULL,NULL),(54,'2','2024-06-26','2024-06-26','<p>Subject: Application for One Day Leave_ Bank Work</p>\r\n\r\n<p>Dear sir/mam,</p>\r\n\r\n<p>I am writing to request a one-day leave on 26-06-2024 to attend to some urgent bank-related work. This task requires my personal presence at the bank and cannot be completed outside of working hours.</p>\r\n\r\n<p><br />\r\nThank you for your understanding.</p>\r\n\r\n<p>Sincerely,<br />\r\nSharathchandra B R</p>\r\n','2024-06-26 01:28:32',NULL,NULL,1,NULL,38,'1','0','1',0,NULL,NULL),(55,'2','2024-06-28','2024-06-27','<p>&nbsp;</p>\r\n\r\n<p>I am writing to formally request a leave of absenc order to visit my hometown. This trip is important to me as it will allow me to reconnect with my family and attend to some personal matters.</p>\r\n\r\n<p>I have ensured that my current projects are up to date and I am willing to delegate my tasks to ensure a smooth workflow during my absence. I will be accessible by email should any questions arise during my leave.</p>\r\n\r\n<p>Thank you for considering my request. I look forward to your favorable response.</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Jayamani</p>\r\n\r\n<p>Mine</p>\r\n','2024-06-26 03:32:06',NULL,NULL,1,'1',7,'1','0','2',0,NULL,NULL),(56,'2','2024-06-26','2024-06-26','<p>Sick</p>\r\n','2024-06-26 03:45:56',NULL,NULL,1,NULL,36,'1','0','1',0,NULL,NULL),(57,'2','2024-07-01','2024-07-01','<p>Subject: Request for Leave on 01/07/2024.</p>\r\n\r\n<p>Dear Sir/Madam,</p>\r\n\r\n<p>I am Shashi Bhavan C K from Merry&#39;s Info Tech &amp; New-Gen Educare Company. I am writing to formally request a leave of absence on the 1st of july, 2024 to visit my home temple.</p>\r\n\r\n<p>I have ensured that all my current tasks and responsibilities are up to date, and I am confident that my absence will not affect ongoing projects. Additionally, my colleague, Abdul, has kindly agreed to take care of any tasks that may arise during my leave.</p>\r\n\r\n<p>Thank you for considering my request. I look forward to your approval.</p>\r\n\r\n<p>Sincerely,<br />\r\nShashi Bhavan C K<br />\r\nMerry&#39;s Info Tech &amp; New-Gen Educare Company</p>\r\n','2024-06-26 08:58:16',NULL,NULL,1,NULL,22,'1','0','1',0,NULL,NULL),(58,'2','2024-06-28','2024-06-27','<p>Subject: Leave Request for Health Checkup - 27th &amp; 28th June 2024</p>\r\n\r\n<p>Dear Jayamani,</p>\r\n\r\n<p>I hope this message finds you well.</p>\r\n\r\n<p>I am writing to inform you that I need to undergo a health checkup on the 27th and 28th of June, 2024. As such, I would like to request leave for these two days.</p>\r\n\r\n<p>I have ensured that all my current tasks and responsibilities are up to date and have handed over any pending work to Abdul. They have kindly agreed to manage any urgent issues during my absence. I will be available by phone or email for any critical matters.</p>\r\n\r\n<p>Please let me know if you need any additional information or if there are any specific procedures I need to follow to formalize this leave request.</p>\r\n\r\n<p>Thank you for your understanding and support.</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>Harish R<br />\r\nFront End Developer<br />\r\n8792680188</p>\r\n','2024-06-26 09:13:26',NULL,NULL,1,NULL,39,'1','0','2',0,NULL,NULL),(59,'5','','','<p>Need one hour permission,<br />\r\nNeed to go temple on account of&nbsp;wedding anniversary kindly grant</p>\r\n','2024-06-26 09:22:05',NULL,NULL,1,NULL,32,'1','0','0',0,'2024-06-26T18:00','2024-06-26T19:00'),(60,'5','','','<p>I need to go home, and I kindly request you to give me permission for 1 hour, Since I have to pack my things and reach the boarding point on time.</p>\r\n\r\n<p>Thanks and Regards,</p>\r\n\r\n<p>Meena M</p>\r\n','2024-06-26 12:31:11',NULL,NULL,1,NULL,33,'1','0','0',0,'2024-06-26T18:00','2024-06-26T19:00'),(61,'5','','','<p>Hello,</p>\r\n\r\n<p>I&#39;m going home so I&#39;m leaving 1 hour early.</p>\r\n\r\n<p>Thanks &amp; Regards,</p>\r\n\r\n<p>K Sumanth Kumar Raju.</p>\r\n','2024-06-26 12:33:41',NULL,NULL,1,NULL,29,'1','0','0',0,'2024-06-26T18:01','2024-06-26T19:01'),(62,'2','2024-07-02','2024-07-01','<p>Dear Dr.Karthikeyan,</p>\r\n\r\n<p>I hope this message finds you well. I am writing to formally request two days of leave on 1st and 2nd July 2024. The purpose of this leave is to attend an appointment related to my passport.</p>\r\n\r\n<p>I have ensured that my current tasks are up to date and have informed my team about my absence to ensure minimal disruption. I will be accessible by phone and email during this period to address any urgent matters that may arise.</p>\r\n\r\n<p>Please let me know if there are any specific procedures or forms I need to complete for this leave request. I appreciate your consideration of my request and look forward to your approval.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Best regards,<br />\r\nSabari Raj S R&nbsp;<br />\r\nFrontend Developer &amp; Web Administrator</p>\r\n','2024-06-26 13:17:27',NULL,NULL,1,NULL,16,'1','0','2',0,NULL,NULL),(63,'2','2024-06-28','2024-06-28','<p>Im&nbsp; going home on my personal reason so im taking leave on Friday.</p>\r\n\r\n<p>Warm Regrads,</p>\r\n\r\n<p>M.Jyothsna</p>\r\n\r\n<p>Frontend Developer</p>\r\n\r\n<p>&nbsp;</p>\r\n','2024-06-26 13:21:40',NULL,NULL,1,NULL,25,'1','0','1',0,NULL,NULL),(64,'Others','2024-06-28','2024-06-28','<p>Subject :- Requesting for one day leave due to going hometown&nbsp;<br />\r\nAs per the above subject i have some emergency at my home so i request you to grant me a leave for&nbsp; a day.<br />\r\n<br />\r\nthanks &amp; regards,<br />\r\nDilip P</p>\r\n','2024-06-27 08:53:04',NULL,NULL,1,NULL,24,'1','1','1',0,NULL,NULL),(65,'2','2024-06-28','2024-06-28','<p>I am writing to request leave on [28-06-2024] to attend my grandfather&#39;s Thithi ceremony, which is a significant family event. I will ensure all urgent tasks are handled before my leave and will be available via phone for any emergencies.</p>\r\n','2024-06-27 11:53:54',NULL,NULL,1,NULL,37,'1','0','1',0,NULL,NULL),(66,'Others','2024-06-28','2024-06-28','<p>Due to health issue I want to go for hospital&nbsp;</p>\r\n','2024-06-28 03:15:33',NULL,NULL,1,NULL,30,'1','1','1',0,NULL,NULL),(67,'5','','','<p><strong>Subject: Request for One-Hour Leave to Visit Native Place</strong></p>\r\n\r\n<p>Dear Sir/mam,</p>\r\n\r\n<p>I kindly request permission to take a one-hour leave today to visit my native place for an urgent matter.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Best regards,<br />\r\nSharathChandra B R</p>\r\n','2024-06-28 12:17:34',NULL,NULL,1,NULL,38,'1','0','0',0,'2024-06-28T18:01','2024-06-28T19:01'),(68,'2','','','<p>Greetings maam,&nbsp;<br />\r\n<br />\r\nI would like to take a leave on monday and tuesday as i am travelling back to home to visit my grandfather who is in poor health.&nbsp;</p>\r\n','2024-06-29 05:47:25',NULL,NULL,1,NULL,61,'1','0','0',0,'2024-07-01T09:00','2024-07-01T10:00'),(69,'2','2024-07-01','2024-07-01','<p>Hello, I am writing to inform you that I am unable to attend work due to high fever today i.e, 1st of July.</p>\r\n\r\n<p>I apologize for any inconvenience and my absence will not affect the on going projects and appreciate your understanding.</p>\r\n','2024-07-01 01:36:35',NULL,NULL,1,NULL,29,'1','0','1',0,NULL,NULL),(70,'2','2024-07-02','2024-07-01','<p>Dear Sir,&nbsp;</p>\r\n\r\n<p>Greetings of the day!&nbsp;</p>\r\n\r\n<p>I have done my medical check up but the reports are coming on Tuesday only and I have to consult the doctor and I will come back to office on Wednesday, I request you to extend my leave till Wednesday (Jul 7th).</p>\r\n\r\n<p>Thanks and Regards,&nbsp;</p>\r\n\r\n<p>Meena M</p>\r\n\r\n<p>Automation Test Engineer</p>\r\n','2024-07-01 02:19:18',NULL,NULL,1,NULL,33,'1','0','2',0,NULL,NULL),(71,'2','2024-07-01','2024-07-01','<p>I hope this message finds you well. I m feeling unwell today due to headache and cold. Consequently, I will be unable to perform my duties effectively. I&#39;ll keep you updated on my progress and ensure a smooth transition of my tasks during my absence.</p>\r\n\r\n<p>Therefore, I kindly request a one day leave.I appreciate your understanding and support in this matter.</p>\r\n\r\n<p>Appreciate your understanding.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>Nithyashree N Bannur</p>\r\n\r\n<p>Jr Java developer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','2024-07-01 02:48:33',NULL,NULL,1,NULL,31,'1','0','1',0,NULL,NULL),(72,'2','2024-07-02','2024-07-02','<p>Please excuse me as I am travelling back home due to my grandfather being sick.&nbsp;<br />\r\n<br />\r\nI will come to office from wednesday.&nbsp;</p>\r\n','2024-07-01 06:05:20',NULL,NULL,1,NULL,61,'1','0','1',0,NULL,NULL),(77,'5','','','<p>We have Payed the Rent for the PG for the New Employee of Our Company(Ajith N)</p>\r\n','2024-07-02 04:44:32',NULL,NULL,1,NULL,47,'1','0','0',0,'2024-07-02T09:00','2024-07-02T10:00'),(78,'5','','','<p>Permission Due to heavy traffiv in hebbal&nbsp;</p>\r\n','2024-07-02 04:55:18',NULL,NULL,1,NULL,32,'1','0','0',0,'2024-07-02T10:01','2024-07-02T11:01'),(80,'2','2024-07-03','2024-07-03','<p>My husband not feeling well need to take him to hospital.</p>\r\n\r\n<p>Kindly accept my request&nbsp;</p>\r\n','2024-07-03 03:31:44',NULL,NULL,1,NULL,32,'1','0','1',0,NULL,NULL),(82,'2','2024-07-06','2024-07-06','<p>I am Divya M N, a Backend Developer. I am requesting casual leave on 06-07-2024 (Saturday) as I have a dental appointment for a teeth clip placement. I assure you that my leave will not affect any ongoing projects, as I am completing my tasks on schedule. Kindly approve my leave request.</p>\r\n','2024-07-03 12:15:16',NULL,NULL,1,NULL,15,'1','0','1',0,NULL,NULL),(84,'Others','2024-07-04','2024-07-04','<p>Dear Sharanya,</p>\r\n\r\n<p>I hope this message finds you well. Due to some emergency , I need to request emergency leave 04-07-2024. I&#39;ve ensured tasks are handled appropriately. Please advise if any specific protocols need to be followed. Thank you for your understanding and support.</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>Nithyashree N Bannur</p>\r\n','2024-07-04 02:44:37',NULL,NULL,1,NULL,31,'1','1','1',0,NULL,NULL),(85,'5','','','<p><strong>Subject</strong>: <strong>Request for Early Departure Approval,</strong></p>\r\n\r\n<p>I hope this message finds you well. I am writing to request your approval for leaving the office one hour earlier than usual today due to an emergency situation that requires my immediate attention outside of work.</p>\r\n\r\n<p>I apologize for any inconvenience this may cause and appreciate your understanding in this matter. Please let me know if you need any further information or if there are any specific protocols I should follow.</p>\r\n\r\n<p><strong>Thank you for your consideration.</strong></p>\r\n\r\n<p><strong>Best regards,</strong></p>\r\n\r\n<p><strong>Dilip P<br />\r\nPython Developer<br />\r\n+91 9743591277</strong></p>\r\n','2024-07-04 11:38:04',NULL,NULL,1,NULL,24,'1','0','0',0,'2024-07-04T18:00','2024-07-04T19:00'),(86,'2','2024-07-05','2024-07-05','<p>I had a medical appointment tomorrow i need leave&nbsp;</p>\r\n','2024-07-04 11:54:19',NULL,NULL,1,NULL,50,'1','0','1',0,NULL,NULL),(87,'Others','2024-07-06','2024-07-05','<p>Husband not feeling well - Taken to hospital.</p>\r\n','2024-07-06 01:31:02',NULL,NULL,1,NULL,32,'1','1','2',0,NULL,NULL),(88,'2','2024-07-08','2024-07-08','<p>Subject: Request for One Day Leave.</p>\r\n\r\n<p>Dear Sir/Ma&#39;am,</p>\r\n\r\n<p>I hope this message finds you well. I am writing to request one day&#39;s leave on 08-07-2024 to complete my Aadhar verification.</p>\r\n\r\n<p>Thank you&nbsp;</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>Sharathchandra B R.</p>\r\n','2024-07-06 20:12:30',NULL,NULL,1,NULL,38,'1','0','1',0,NULL,NULL),(91,'2','2024-07-09','2024-07-09','<p>Experiencing a heavy cough and fever&nbsp;</p>\r\n','2024-07-09 03:10:25',NULL,NULL,1,NULL,47,'1','0','1',0,NULL,NULL),(92,'Others','2024-07-12','2024-07-08','<p>Work from Home</p>\r\n','2024-07-09 07:56:20',NULL,NULL,1,NULL,67,'1','1','5',0,NULL,NULL),(93,'5','','','<p>Due to heavy traffic I couldn&#39;t be able to reach the office on time&nbsp;</p>\r\n','2024-07-10 04:00:10',NULL,NULL,1,NULL,34,'1','0','0',0,'2024-07-10T10:00','2024-07-10T11:00'),(94,'5','','','<p>I am in need of one hour permission since my relatives came here to meet me, Kindly approve for the same. Thanks in advance</p>\r\n','2024-07-10 09:05:23',NULL,NULL,1,NULL,33,'1','0','0',0,'2024-07-10T15:00','2024-07-10T16:00'),(95,'Others','2024-07-13','2024-07-08','<p>I have been diagnosed with dengue fever and am currently feeling unwell.</p>\r\n','2024-07-11 07:58:05',NULL,NULL,1,NULL,10,'1','1','6',0,NULL,NULL),(97,'2','2024-07-16','2024-07-15','<p>Dear Sir/Mam,</p>\r\n\r\n<p>I hope this message finds you well.</p>\r\n\r\n<p>I am writing to request leave for two days, from 15/07/2024 to 16/07/2024. I have some personal matters that need my attention during this time.</p>\r\n\r\n<p>I will ensure that all my tasks are up to date before I leave and will be available for any urgent matters via email.</p>\r\n\r\n<p>Thank you for considering my request.</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>M.Jyothsna</p>\r\n','2024-07-11 15:31:56',NULL,NULL,1,NULL,25,'1','0','2',0,NULL,NULL),(99,'2','2024-07-12','2024-07-12','<p>Subject :- Requesting for a one day leave due to health issues&nbsp;</p>\r\n\r\n<p>As per the above subject I&#39;m not well so I request you to grant me a one day leave..</p>\r\n\r\n<p>Thanks and regards,</p>\r\n\r\n<p>Dilip P&nbsp;</p>\r\n','2024-07-12 02:14:40',NULL,NULL,1,NULL,24,'1','0','1',0,NULL,NULL),(100,'2','2024-07-12','2024-07-12','<p>I hope this message finds you well. I am writing to inform you that I am feeling unwell and will not be able to come to work today. I have seen a doctor and have been advised to rest.</p>\r\n\r\n<p>I will keep you updated on my condition and inform you when I am able to return to work. I apologize for any inconvenience this may cause and will ensure that all my pending tasks are covered.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Best regards,<br />\r\nAbdul Ahad<br />\r\nFront End Developer<br />\r\nabdulahad@mineit.tech<br />\r\nMine</p>\r\n','2024-07-12 02:38:37',NULL,NULL,1,NULL,28,'1','0','1',0,NULL,NULL),(102,'2','2024-07-12','2024-07-12','<p>Subject: Request for Half Day Leave</p>\r\n\r\n<p>Dear sir/maam,</p>\r\n\r\n<p>I hope this email finds you well. I am writing to request a half-day leave on 12/07/24 due to travel plans to my native place. I will be available in the morning and will complete any urgent tasks before I leave.</p>\r\n\r\n<p>Thank you for your understanding and support.</p>\r\n\r\n<p>Best regards,<br />\r\nBHANU PRASAD YADAV P<br />\r\nJr Java developer<br />\r\n9632920686</p>\r\n','2024-07-12 05:08:20',NULL,NULL,1,NULL,30,'1','0','1',0,NULL,NULL),(103,'2','2024-07-16','2024-07-15','<p>Dear sir,i hope this message&nbsp;finds you in good health.i am writing to request a leave to addent&nbsp;my uncle ceremony,which is family event on 15/7/24 to 16/7/24, so please consider my leave.</p>\r\n\r\n<p>Thanks &amp; regards</p>\r\n\r\n<p>G.paranthaman</p>\r\n','2024-07-12 07:16:57',NULL,NULL,1,NULL,40,'1','0','2',0,NULL,NULL),(104,'5','','','<p>I am writing to request permission to leave the office early today as I need to catch a bus to my hometown to ensure a timely arrival at my home. I will make sure to complete all my tasks before leaving.</p>\r\n','2024-07-12 10:22:24',NULL,NULL,1,NULL,2,'1','0','0',0,'2024-07-12T18:00','2024-07-12T19:00'),(106,'2','2024-07-19','2024-07-18','<p>I am writing to request leave on 18th and 19th July 2024 in order to attend my practical exams scheduled for these dates. I kindly ask for your permission to be absent on these days so that I can focus on my exams. I assure you that I will complete all my pending work before my leave and will catch up on any missed tasks upon my return.</p>\r\n\r\n<p>Thank you for your understanding and support.</p>\r\n','2024-07-17 10:06:19',NULL,NULL,1,NULL,2,'1','0','2',0,NULL,NULL),(107,'2','2024-07-21','2024-07-21','<p>I hope this message finds you well. I am writing to request leave from 21/07/2024&nbsp;to 21/07/2024&nbsp; due to [reason for leave].</p>\r\n\r\n<p>During my absence, I will ensure that all my responsibilities are covered. Please let me know if there are any specific tasks you would like me to address before I leave.</p>\r\n\r\n<p>Thank you for considering my request. I look forward to your approval.</p>\r\n','2024-07-20 11:59:36',NULL,NULL,1,NULL,7,'1','0','1',0,NULL,NULL),(109,'2','2024-08-20','2024-08-19','<p>Dear Dr.Karthikeyan,</p>\r\n\r\n<p>I hope this email finds you well.</p>\r\n\r\n<p>I am writing to inform you that I have been recovering from typhoid, and while my fever has reduced only two days ago, I am still not fully recovered. Upon my doctor&#39;s advice, I will need to take additional rest to ensure a complete recovery. Therefore, I would like to request sick leave for Monday, August 19th, and Tuesday, August 20th.</p>\r\n\r\n<p>If my health does not improve by then, I may need to extend my leave, and I will keep you updated on my condition. Please rest assured that I am committed to completing my project on time once I am fully recovered.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Best regards,<br />\r\nSabari Raj S R</p>\r\n','2024-08-18 13:15:42',NULL,NULL,1,NULL,16,'1','0','2',0,NULL,NULL),(110,'2','2024-08-20','2024-08-19','<p>Good morning [Sir/Madam],</p>\r\n\r\n<p>I am Ashwini Satti, working at MINE. I would like to request&nbsp; casual leave for tomorrow, 19th August 2024, as we are celebrating a festival at our home for Raksha Bandhan.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p>Best regards,<br />\r\nAshwini Satti</p>\r\n','2024-08-18 16:32:47',NULL,NULL,0,NULL,35,'1','0','2',0,NULL,NULL),(111,'2','2024-08-19','2024-08-19','<p>Due to an unexpected emergency, I will be return to the office tomorrow. I apologize for any inconvenience and will ensure that my tasks are completed.</p>\r\n','2024-08-19 04:09:55',NULL,NULL,0,NULL,37,'1','0','1',0,NULL,NULL),(112,'Others','2024-08-19','2024-08-19','<p>Dear Meena,</p>\r\n\r\n<p>I hope this mail finds you well. I am writing to formally request the payment of my pending salary for the months of May, June and July.</p>\r\n\r\n<p>Despite the fact that it is now July month, I have yet to receive my salary for May and June months. This has caused significant financial and mental stress because of this i am unable to focus on my work and complete task. I kindly request that this matter be addressed as soon as possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I have always valued my role as&nbsp;</p>\r\n\r\n<p>Jr. Automation engineer at Mine and have consistently strived to perform my duties to the best of my abilities.</p>\r\n\r\n<p>Please let me know if there are any additional details or steps required from my end to expedite this process.</p>\r\n\r\n<p>Thank you for your understanding and assistance.</p>\r\n\r\n<p>Best regards,</p>\r\n\r\n<p>Vaibhavi Khiranand Dhadde&nbsp;</p>\r\n\r\n<p>Jr Automation Engineer&nbsp;</p>\r\n','2024-08-19 04:14:09',NULL,NULL,0,NULL,21,'1','1','1',0,NULL,NULL),(113,'2','2024-08-19','2024-08-19','<p>I hope this message finds you well. I am writing to inform you that I am unable to make it to work today as the bus I was traveling on has broken down, and there is no immediate alternative transportation available.</p>\r\n\r\n<p>I sincerely apologize for the inconvenience this may cause and request leave for today, 19th August 2024.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n\r\n<p><strong>Best regards,</strong><br />\r\nLatika</p>\r\n','2024-08-19 09:36:32',NULL,NULL,0,NULL,60,'1','0','1',0,NULL,NULL),(114,'2','2024-08-21','2024-08-21','<p>Subject: Leave Application Due to Illness</p>\r\n\r\n<p>Dear Sir/Ma&#39;am,</p>\r\n\r\n<p>I am writing to inform you that I am unwell and will not be able to attend work on 21-8-2024. I will keep you updated on my recovery and will return to work as soon as I am able.</p>\r\n\r\n<p>Thank you for your understanding.</p>\r\n','2024-08-21 02:39:55',NULL,NULL,0,NULL,22,'1','0','1',0,NULL,NULL);
