INSERT INTO `teamrequried` VALUES (8,'53',NULL,NULL,NULL,NULL,'Ticket Closed','0',NULL,'other','Canva Subscription, Freepik','We need Canva Subscription to work and for other design works.','7',NULL,'1','2024-06-19 06:48:40','i forword to nisha','1','1','0','Ticket_9992'),(12,'53',NULL,NULL,NULL,NULL,'Forword','0',NULL,'Hardware Issue','Need storage space to render Creatives','<p>Due to usage my personal laptop I&#39;m running out of storage, please make a step to figure it out. Or make arrangements for new work system.</p>\r\n','7',NULL,'1','2024-06-21 07:29:10','Check and make the arrangements','1','1','0','Ticket_4043'),(13,'33',NULL,NULL,NULL,NULL,'Approve','0',NULL,'Software Issue','Not able to apply leave','<p>Im trying apply leave but im not able to apply and getting below error code</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Warning</strong>: Undefined array key &quot;leaveType&quot; in&nbsp;<strong>/home/snh6/domains/jiffy.mineit.tech/public_html/jiffy/project/leave.php</strong>&nbsp;on line&nbsp;<strong>30</strong><br />\r\n<br />\r\n<strong>Warning</strong>: Undefined array key &quot;leaveNamePolicy&quot; in&nbsp;<strong>/home/snh6/domains/jiffy.mineit.tech/public_html/jiffy/project/leave.php</strong>&nbsp;on line&nbsp;<strong>31</strong><br />\r\n<br />\r\n<strong>Fatal error</strong>: Uncaught mysqli_sql_exception: Column &#39;title&#39; cannot be null in /home/snh6/domains/jiffy.mineit.tech/public_html/jiffy/project/leave.php:44 Stack trace: #0 /home/snh6/domains/jiffy.mineit.tech/public_html/jiffy/project/leave.php(44): mysqli_stmt-&gt;execute() #1 {main} thrown in&nbsp;<strong>/home/snh6/domains/jiffy.mineit.tech/public_html/jiffy/project/leave.php</strong>&nbsp;on line&nbsp;<strong>44</strong></p>\r\n','7',NULL,'1','2024-06-25 10:49:32','done','','1','0','Ticket_3520'),(14,'26',NULL,NULL,NULL,NULL,'Approve','0',NULL,'Hardware Issue','Requesting Replacement For Charger','<p>My laptop charger got burnt and has not been working since the last 2 days, I