ULL,'other','Requesting for the LAN connector','<p>As per the subject I request you to provide me the LAN connector because I&#39;m facing the internet issue .</p>\r\n\r\n<p>Thanks and regards&nbsp;</p>\r\n\r\n<p>Shashi&nbsp;</p>\r\n','1',NULL,'1','2024-06-27 14:06:42',NULL,NULL,'0','0','Ticket_5698'),(23,'26',NULL,NULL,NULL,NULL,'Pending','0',NULL,'Hardware Issue','I need Mac Connector','<p>I need 8 in 1 Mac connector and also a good&nbsp;monitor&nbsp;to&nbsp;work&nbsp;efficiently. Please give me as soon as possible.<br />\r\nThank you<br />\r\n<br />\r\nRegards,<br />\r\nAjith Kumar</p>\r\n','1',NULL,'1','2024-06-27 14:12:09',NULL,NULL,'0','0','Ticket_8290'),(24,'22',NULL,NULL,NULL,NULL,'Pending','0',NULL,'other','USB Extender ','<p>The issue is I&#39;m not able to mouse, keyboard and LAN connector at a time so that I need the USB Extender&nbsp;</p>\r\n','1',NULL,'1','2024-06-27 14:17:56',NULL,NULL,'0','0','Ticket_8731'),(25,'21',NULL,NULL,NULL,NULL,'Ticket Closed','0',NULL,'Network Issue','Request for Ethernet LAN port.','<p>I am writing to request the&nbsp;Ethernet LAN port at my workstation. Due to the nature of my work, a stable and high-speed internet connection is essential for me to perform my tasks efficiently. Currently, I am experiencing some connectivity issues with the Wi-Fi, which is affecting my productivity.</p>\r\n','1',NULL,'1','2024-06-28 06:38:23',NULL,NULL,'1','0','Ticket_9235'),(26,'2',NULL,NULL,NULL,NULL,'Pending','0',NULL,'Hardware Issue','Requesting Ethernet Port','<p>My laptop doesn&#39;t support Ethernet cable. So I need Ethernet port to get a stable internet connection.&nbsp;</p>\r\n','1',NULL,'1','2024-07-01 10:37:36',NULL,NULL,'1','0','Ticket_3766'),(27,'39',NULL,NULL,NULL,NULL,'Forword','0',NULL,'other','Hardware ','<p>I Need to solve bugs in bluechip in my mac its not supporting to download workbench<br />\r\nso i need proper laptop with eclipes and workbench instillation&nbsp;<br />\r\nif i need dont reseve my work will get delay be